import React, {Component} from 'react'
import MyMusicContainer from './MyMusicContainer'
import FindMusicContainer from './FindMusicContainer'

class MainContainer extends Component {

  render() {
    return (
      <div>
        MainContainer
        <MyMusicContainer />
        <FindMusicContainer />
      </div>
    )
  }
}

export default MainContainer
